ori=""

def PatternCount(text, pattern):
    count = 0
    for i in range(len(text) - len(pattern) + 1):
        if text[i:i+len(pattern)] == pattern:
            count = count + 1
    return count

def FrequencyMap(text, k):
    freq = {}
    n = len(text)
    for i in range(n-k+1):
        pattern = text[i:i+k]
        freq[pattern] = 0
    for i in freq:
        count = 0
        freq[i] = PatternCount(text, i) 
        count += 1
    return freq

test = FrequencyMap(ori, 3)
print(test)

